import{_ as e,o as r,c as a,O as t}from"./chunks/framework.9482e208.js";const f=JSON.parse('{"title":"§ 54.1-3456.1 Drugs of concern.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/54.1-3456.1.md","filePath":"vacode/54.1-3456.1.md"}'),o={name:"vacode/54.1-3456.1.md"},n=t('<h1 id="§-54-1-3456-1-drugs-of-concern" tabindex="-1">§ 54.1-3456.1 Drugs of concern. <a class="header-anchor" href="#§-54-1-3456-1-drugs-of-concern" aria-label="Permalink to &quot;§ 54.1-3456.1 Drugs of concern.&quot;">​</a></h1><p>The Board may promulgate regulations designating specific drugs and substances, including any controlled substance or other drug or substance where there has been or there is the actual or relative potential for abuse, as drugs of concern. Drugs or substances designated as drugs of concern shall be reported to the Department of Health Professions and shall be subject to reporting requirements for the Prescription Monitoring Program established pursuant to Chapter 25.2 (§ <a href="/vacode/54.1-2519/">54.1-2519</a> et seq.).</p><p>2014, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?141+ful+CHAP0664" target="_blank" rel="noreferrer">664</a>; 2017, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?171+ful+CHAP0181" target="_blank" rel="noreferrer">181</a>; 2019, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?191+ful+CHAP0214" target="_blank" rel="noreferrer">214</a>.</p>',3),s=[n];function c(i,l,d,g,u,_){return r(),a("div",null,s)}const p=e(o,[["render",c]]);export{f as __pageData,p as default};
